import back from "../components/Botton/back.vue";
export default {
  components: {
    back
  },
  created() {
    this.getrankList();
  },
  data() {
    return {};
  },
  methods: {
    gojump(id, rank, int) {
      this.$store.commit("upListTypeId", {
        id,
        rank,
        int
      });
      this.$router.push("/ranklistdetails");
    },
    getrankList() {
      this.$store.dispatch("asyncgetranklist");
    }
  }
};
